import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <img src={ Logo } alt="Alligator.io Logo" width="200" />
        <h1>useEffect Hook</h1>
        <ClassBasedComponent />
      </div>
    );
  }
}

export default App;
